import logo from './logo.svg';
import Menu from './components/MenuComponent';
import { DISHES } from './shared/dishes';             // shared dishes attribute for all files
import { Navbar, NavbarBrand } from 'reactstrap';
import ItemDetail from './components/ItemDetail';
import { Link, BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';    // in v6 of react-router-dom, Switch is replaced by Routes
import './App.css';
import React from 'react';

class App extends React.Component {

  constructor(props) {
    super(props);

    this.state = {
      dishes: DISHES
    };

  }

  render() {
    return (
      <div>
        <div className="App">
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <p>
              Edit <code>src/App.js</code> and save to reload.
            </p>
            <a
              className="App-link"
              href="https://reactjs.org"
              target="_blank"
              rel="noopener noreferrer"
            >
              Learn React
            </a>
          </header>
        </div>
        <div>
          <Menu dishes={this.state.dishes}/>
        </div>
      </div>
    );
  };
}

export default App;
